import React, { useState } from 'react';
import './Dashboard.css';

function Dashboard() {
    const [activeTab, setActiveTab] = useState('종합 대시보드');

    // 좌측 네비게이션 바 항목
    const sidebarItems = [
        '종합 대시보드',
        '개별 대시보드',
        '최대수요전력 관리',
        '검침 데이터 조회',
        '에너지 사용 요약',
        '에너지 사용량 조회',
        '공정별 에너지 사용량 비교'
    ];

    // 임의 데이터
    const barChartData = [
        { label: 'A공정', value: 318304 },
        { label: 'B공정', value: 333655 },
        { label: 'C공정', value: 414512 },
    ];
    const lineChartData = [54, 57, 63, 45, 39, 49, 53];
    const tableData = [
        { device: '검침기기 1', value: 2850, unit: 'kW', status: '가동 중' },
        { device: '검침기기 2', value: 917, unit: 'kW', status: '가동 중' },
        { device: '검침기기 3', value: 2058, unit: 'kW', status: '가동 중' },
    ];

    return (
        <div className="dashboard-layout">
            {/* 좌측 네비게이션 바 */}
            <div className="sidebar">
                <div className="sidebar-header">
                    <h2>FEMS</h2>
                    <p>개발자_관리자</p>
                </div>
                <ul className="menu">
                    {sidebarItems.map((item, index) => (
                        <li
                            key={index}
                            className={`menu-item ${activeTab === item ? 'active' : ''}`}
                            onClick={() => setActiveTab(item)}
                        >
                            {item}
                        </li>
                    ))}
                </ul>
            </div>

            {/* 메인 콘텐츠 */}
            <div className="main-container">
                <div className="tab-bar">
                    <h2>{activeTab}</h2>
                </div>

                <div className="dashboard-content">
                    <div className="card-grid">
                        <div className="card">
                            <h2>최대 수요전력</h2>
                            <p className="highlight">89.46% (주의)</p>
                        </div>
                        <div className="card">
                            <h2>누적 사용량(전력)</h2>
                            <p className="highlight">115,908 MWh</p>
                            <p>9,030 MWh (단월)</p>
                        </div>
                        <div className="card">
                            <h2>온실가스 누적 배출량</h2>
                            <p className="highlight">26,658.90 TOE</p>
                        </div>
                        <div className="card">
                            <h2>전력 소비 비용</h2>
                            <p className="highlight">45,372 천원</p>
                        </div>
                    </div>

                    <div className="chart-grid">
                        <div className="chart-card">
                            <h2>전력 사용량 추이</h2>
                            <div className="line-chart">
                                {lineChartData.map((value, index) => (
                                    <div
                                        key={index}
                                        className="line-point"
                                        style={{
                                            left: `${index * 16}%`,
                                            bottom: `${value}%`,
                                        }}
                                    ></div>
                                ))}
                            </div>
                        </div>

                        <div className="chart-card">
                            <h2>공정별 에너지 소비</h2>
                            <div className="bar-chart">
                                {barChartData.map((data, index) => (
                                    <div
                                        key={index}
                                        className="bar"
                                        style={{
                                            width: `${(data.value / 500000) * 100}%`,
                                        }}
                                    >
                                        <span>{data.value}</span>
                                    </div>
                                ))}
                            </div>
                        </div>
                    </div>

                    <div className="table-container">
                        <h2>주요 검침현황</h2>
                        <table>
                            <thead>
                                <tr>
                                    <th>검침기기</th>
                                    <th>순시</th>
                                    <th>단위</th>
                                    <th>상태</th>
                                </tr>
                            </thead>
                            <tbody>
                                {tableData.map((row, index) => (
                                    <tr key={index}>
                                        <td>{row.device}</td>
                                        <td>{row.value}</td>
                                        <td>{row.unit}</td>
                                        <td>{row.status}</td>
                                    </tr>
                                ))}
                            </tbody>
                        </table>
                    </div>
                </div>
            </div>
        </div>
    );
}

export default Dashboard;
